import React from "react"
import './css/App.css';
import Tracker from './components/WatchTracker'

const App = () => {

  return (
    <div className="App-container">
      <header className="App-header">
        <h1 className="App-title">RDE VeriTest (Dev) [V1.9.7]</h1>
        <Tracker />
      </header>
    </div>
  );

};

export default App;
